import React from "react";
import {Route, Switch, useRouteMatch} from "react-router";
import {Link} from "react-router-dom";

import {mainNavConfig} from "../../_common/common-app-configuration";

import {MainHeaderArea} from "../../_common/main-header-area/main-header-area";
import {Navigation} from "../../../view-components/list-menu/intra-app-navigation";
import {CatalogOverviewView} from "../catalog-overview/catalog-overview-view";

interface iPROPS {
    message: string;
}

interface iSTATE{

}

export class CatalogLandingPageView extends React.Component<iPROPS, iSTATE>{
    constructor(props:iPROPS) {
        super(props);

    }

    render(){
        let {path, url} = useRouteMatch();
        return(
            <>
                <MainHeaderArea
                    sectionTitle="Landing Page"
                    navigationElement={<Navigation menuHelpStyle="panel" navElements={mainNavConfig} />}
                />
                <Link to={`${path}/overview`}>Overview</Link>
                <Link to={`${path}/overview`}>Dash</Link>
                <Link to={`${path}/overview`}>Spreadsheet</Link>

                <Switch>
                    <Route path={`${path}/overview`} component={()=><CatalogOverviewView message="nested overview"/>} />
                    <Route path={`${path}/dashboard`} component={()=><CatalogOverviewView message="nested dash"/>} />
                    <Route path={`${path}/spreadsheet`} component={()=><CatalogOverviewView message="nested spreadsheet"/>} />
                </Switch>

                <h2>Your Catalog</h2>
                <h3>{this.props.message}</h3>
            </>
        );
    }
}
